import React, { Component } from 'react';
import './settings.css';

export default class componentName extends Component {
  render() {
    return (
      <div>
        <div>

            <form className='temperature-form'>
                <label htmlFor="energy-usage">Set energy usage warning threshold: </label>
                <input type="text" id="energy-usuage" name="Energy" placeholder="Enter a prefered value"/>
                <input type="submit" id="submit" value="Submit"/>
            </form>
        </div>
      </div>
    )
  }
}
